 import React  from 'react';
import ReactDOM from 'react-dom';
import Card from './Card.jsx';
import Sdata from './Sdata.jsx';


function acard(val){

  return(
    <Card
    key={val.id}
 imgsrc={val.imgsrc}
 name={val.name}
 content={val.content} 
 link={val.link}
  />
  );
  }


ReactDOM.render(
<>

 {Sdata.map(acard)}

</>,
 document.getElementById("root")

);
